description:
Dead Air (2009)  

Verenigde Staten
Horror

geregisseerd door Corbin Bernsen
met Bill Moseley, David Moscow en Patricia Tallman

Een groep mensen die werkt bij een radiostation komt er achter dat een groot aantal zombies op het punt staan te ontsnappen als een explosie zal uitbreken. Via hun radiostation proberen ze de inwoners van Los Angeles, waar het zal gaan afspelen, te waarschuwen.


